graphviz:
digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="center"><font point-size="12"><b>Data Analysis</b></font></td></tr></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  "LoadProcessed" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>LoadProcessed</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Load Processed Data</td></tr></table>>, pad=0.5, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];
  "ComputeMetrics" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>ComputeMetrics</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Compute Metrics</td></tr></table>>, pad=0.5, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];
  "GenerateInsights" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>GenerateInsights</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Generate Insights</td></tr></table>>, pad=0.5, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];
  "CreateVisualizations" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>CreateVisualizations</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Create Visualizations</td></tr></table>>, pad=0.5, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];
  "PublishResults" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>PublishResults</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Publish Results</td></tr></table>>, pad=0.5, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];

  // Edges
  "LoadProcessed" -> "ComputeMetrics" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "ComputeMetrics" -> "GenerateInsights" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "GenerateInsights" -> "CreateVisualizations" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "CreateVisualizations" -> "PublishResults" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
}
